package karsiwek.day05

import java.lang.Integer.max


val input: String = """
dabAcCaCBAcCcaDA
""".trimIndent()

val input2: String =
        """"""

fun reducePolymer(input: String): String {
    return reduce(input, 0);
}

tailrec fun reduce(input: String, idx: Int): String {
    if (idx >= input.length - 1) return input;
    if (input[idx] != input[idx + 1] && input[idx].toLowerCase() == input[idx + 1].toLowerCase()) {
        return reduce(input.removeRange(idx, idx + 2), max(0, idx - 1));
    } else {
        return reduce(input, idx + 1);
    }
}


fun main(args: Array<String>) {
    System.out.print(reducePolymer(input2.split("\n").filter { line -> !line.trim().equals("") }.get(0).trim()).length);
}